import React from "react";
import ProfileInfo from "./ProfileInfo";

const Card = () => {
  return (
    <div>
      <div className="card">
        <div className="card-background-top"></div>
        <div className="card-info">
          <ProfileInfo />
          <div className="stats">
            <div className="stat-info">
              <p>80K</p>
              <p>Followers</p>
            </div>
            <div className="stat-info">
              <p>110K</p>
              <p>Likes</p>
            </div>
            <div className="stat-info">
              <p>2.5K</p>
              <p>Photos</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
